import React from 'react';
import '../App.css';

export default function Login() {
  return (
    <div>
      <form>
        <h1>Welcome Back</h1>
        <label for="email">Email / Username:</label>
        <input type='text' id='email' name='email'></input>

      </form>
    </div>
  )
}
